// src/components/Slider.js
import React from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';

const CarouselSlider = () => {
    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1,
        autoplay: true,
        autoplaySpeed: 3000,
        arrows: true,
    };

    return (
        <div className="w-full max-w-4xl mx-auto mt-16 rounded-lg overflow-hidden">
            <Slider {...settings}>
                <div>
                    <img src="/assets/slider1.png" alt="Tour 1" className="w-full h-80 object-cover" />
                </div>
                <div>
                    <img src="/assets/slider2.jpg" alt="Tour 2" className="w-full h-80 object-cover" />
                </div>
                {/* Add more slides here if needed */}
            </Slider>
        </div>
    );
}

export default CarouselSlider;
